ависит от его типа и способа монтажа https://leader-climate.ru/\r\n  Некоторые из них подразумевают монтаж внешнего блока, для других требуется монтаж специального воздуховода и т https://leader-climate.ru/montazh2etapa\r\n д https://leader-climate.ru/demontazh\r\n \r\nКонтакты и соцсети подтверждены https://leader-climate.ru/zapravka\r\n \r\nДокументы подтверждены https://leader-climate.ru/montazh2etapa\r\n \r\nВнешняя стена не должна превышать 90 см, в ней сверлится отверстие необходимого диаметра для межблочной трассы, в которой будут размещены силовой провод, дренажная и фреоновые трубки https://leader-climate.ru/nestandardmontazh\r\n  Если стена имеет большую толщину то, эти работы проводятся за дополнительную плату с применением альпиниста https://leader-climate.ru/cleaning\r\n  Для отвода конденсата дренажная трубка выводиться от стены на расстояние, как правило, десять-пятнадцать сантиметров, но могут быть и другие варианты, как например вывод дренажа в канализацию https://leader-climate.ru/standardmontazh\r\n  После проведения всех этапов установки, наступают самые важные и крайне необходимые работы, это вакуумирование, пробный пуск и проверка всей системы в целом на разные режимы работы (нагрев, охлаждение). \r\nИнтернет-магазин «Ситиклимат» предлагает не фиксированную стоимость, она формируется в каждом конкретном случае индивидуально https://leader-climate.ru/nestandardmontazh\r\n  Это дает возможность покупателям при заказе комплекса услуг сэкономить на монтаже https://leader-climate.ru/standardmontazh\r\n  Специалистами магазина осуществляется стандартная установка климатической техники в один этап, а также монтаж в два этапа https://leader-climate.ru/nestandardmontazh\r\n  Мастера качественно установят канальные кондиционеры, сплит-системы, промышленные модели и т https://leader-climate.ru/completed-work\r\n д https://leader-climate.ru/zapravka\r\n \r\nЛожный вызов монтажной бригады по вине клиента — 1500 рублей https://leader-climate.ru/diagnostics\"